            <div className="header">
                <nav>
                <ul>
                    <li>
                    <Link to="/">Home</Link>
                    </li>
                    <li>
                    <Link to="/user-account">Account</Link>
                    </li>
                </ul>
                </nav>
                <h1>{props.title}</h1>
                <button 
                className={styles.button}
                onClick={props.clicked}>Toggle Persons</button>
            </div>
        </Router>
    );
};

export default header;
